import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Header from './Header';

const Login = () => {
  const [isLogin, setIsLogin] = useState(true);
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    setError('');

    // Basic validation
    if (!username || !password) {
      setError('Please enter both username and password');
      return;
    }

    // Mock API call - would be replaced with actual backend call
    setTimeout(() => {
      if (isLogin) {
        console.log(`Logging in user: ${username}`);
        // Mock successful login
        localStorage.setItem('user', JSON.stringify({ username, favorites: [1, 3] }));
        navigate('/');
      } else {
        console.log(`Signing up user: ${username}`);
        // Mock successful signup
        localStorage.setItem('user', JSON.stringify({ username, favorites: [] }));
        navigate('/');
      }
    }, 1000);
  };

  return (
    <div style={styles.container}>
      <Header />
      <main style={styles.main}>
        <div style={styles.loginContainer}>
          <h2 style={styles.heading}>
            {isLogin ? 'Login to Your Account' : 'Create an Account'}
          </h2>

          <div style={styles.tabsContainer}>
            <button 
              style={{
                ...styles.tabButton,
                ...(isLogin ? styles.activeTab : {})
              }}
              onClick={() => setIsLogin(true)}
            >
              Login
            </button>
            <button 
              style={{
                ...styles.tabButton,
                ...(!isLogin ? styles.activeTab : {})
              }}
              onClick={() => setIsLogin(false)}
            >
              Sign Up
            </button>
          </div>

          {error && <div style={styles.errorMessage}>{error}</div>}

          <form onSubmit={handleSubmit} style={styles.form}>
            <div style={styles.formGroup}>
              <label htmlFor="username" style={styles.label}>Username</label>
              <input
                type="text"
                id="username"
                style={styles.input}
                value={username}
                onChange={(e) => setUsername(e.target.value)}
              />
            </div>

            <div style={styles.formGroup}>
              <label htmlFor="password" style={styles.label}>Password</label>
              <input
                type="password"
                id="password"
                style={styles.input}
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
            </div>

            <button type="submit" style={styles.submitButton}>
              {isLogin ? 'Login' : 'Sign Up'}
            </button>
          </form>

          <div style={styles.infoText}>
            {isLogin ? (
              <p>After login, you will be able to see your favorite parking spots and quickly access information about them.</p>
            ) : (
              <p>Sign up to save your favorite parking spots and get personalized parking recommendations based on your usage patterns.</p>
            )}
          </div>
        </div>
      </main>
    </div>
  );
};

const styles = {
  container: {
    backgroundColor: '#800000', // Maroon background
    minHeight: '100vh',
    margin: 0,
    padding: 0,
    color: '#FFFFFF',
    fontFamily: 'Arial, sans-serif',
  },
  main: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    padding: '40px 20px',
  },
  loginContainer: {
    backgroundColor: '#EEEEEE',
    borderRadius: '8px',
    padding: '30px',
    width: '100%',
    maxWidth: '500px',
    color: '#333333',
  },
  heading: {
    textAlign: 'center',
    marginTop: 0,
    marginBottom: '20px',
  },
  tabsContainer: {
    display: 'flex',
    marginBottom: '20px',
  },
  tabButton: {
    flex: 1,
    padding: '10px',
    border: 'none',
    background: '#DDDDDD',
    cursor: 'pointer',
    fontWeight: 'bold',
    transition: 'background-color 0.3s',
  },
  activeTab: {
    backgroundColor: '#990000',
    color: 'white',
  },
  errorMessage: {
    backgroundColor: '#FFDDDD',
    color: '#DD0000',
    padding: '10px',
    borderRadius: '4px',
    marginBottom: '15px',
    textAlign: 'center',
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
  },
  formGroup: {
    marginBottom: '15px',
  },
  label: {
    display: 'block',
    marginBottom: '5px',
    fontWeight: 'bold',
  },
  input: {
    width: '100%',
    padding: '10px',
    border: '1px solid #CCCCCC',
    borderRadius: '4px',
    fontSize: '16px',
  },
  submitButton: {
    padding: '12px',
    backgroundColor: '#800000',
    color: 'white',
    border: 'none',
    borderRadius: '4px',
    fontSize: '16px',
    fontWeight: 'bold',
    cursor: 'pointer',
    marginTop: '10px',
  },
  infoText: {
    marginTop: '20px',
    padding: '15px',
    backgroundColor: '#FFFFFF',
    borderRadius: '4px',
    fontSize: '14px',
  },
};

export default Login;
